window.bookSummaryJSON = "<p>With an unexpected temporary addition to the team, Matt, Liz, and Aster venture out unto the ever-expanding frontier. There, they'll deal with the challenge of an unexplored planet and all its hidden dangers.</p> <p>Their journey on the path of ascension continues...but do they have what it takes to persevere?</p> <p><b>Don't miss Book 2 of this action-packed fantasy adventure that blends everything you love about LitRPG with Xianxia. </b></p> <p><b>About the series:</b> <i>This is a mix between LitRPG and Xianxia. It's like a car that looks like a LitRPG with dungeons and skills, but the interior and engine are all Xianxia. It features a magic system and progression system that are logically and internally consistent, as well as realistic fight scenes and a rational MC.</i></p>"; 
